script: |
  super -f text -I q5234.spq | sort > q5234.out

inputs:
  - name: q5234.spq
    data: |
      SELECT col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( CAST ( NULL AS REAL ) + + + col2 > - col2 + col2 + + - 28 ) OR col0 IS NULL;
  - name: tab1

outputs:
  - name: q5234.out
    data: |
